import React from 'react';

import { ColorModeContext, useMode } from './theme'
import { CssBaseline, ThemeProvider } from '@mui/material'
import { Routes, Route, Switch, BrowserRouter as Router,  } from 'react-router-dom';

import Topbar from './scenes/global/Topbar';
// import SideMenu from './scenes/global/SideMenu';
// import Sidebar from './scenes/global/Sidebar';
import Navbar from './scenes/global/Navbar';

import Dashboard from './scenes/dashboard';
import Team from './scenes/team';
import Drivers from './scenes/drivers';
import Bookings from './scenes/bookings';
import Invoices from './scenes/invoices';
import Bar from './scenes/bar';
import Pie from './components/PieGraph';

// import Form from './scenes/form';
// import Line from './scenes/line';
// import Pie from './scenes/pie';
// import Calendar from './scenes/contacts';
// import FAQ from './scenes/faq';



function App() {
  const [theme, colorMode] = useMode();

  return (
  <ColorModeContext.Provider value={colorMode}>
    <ThemeProvider theme={theme}>
      <CssBaseline />
      {/* <div className="app"> */}

        <div className='content'>
          <Router>
            <Navbar />
            <Switch>
              <Route path='/' exact component={Dashboard} />
              <Route path='/bookings' component={Bookings} />
              <Route path='/services' component={Drivers} />
              <Route path='/team' component={Team} />
              <Route path='/invoices' component={Invoices} />
            </Switch>
          </Router>
          {/* <Topbar /> 
